Loja Comercial em empreendimento com alto padrão de construção e acabamento, localizado no Bairro estreito, com grande visibilidade e fluxo, pé direito alto e fachada moderna, com área privativa de 239m² de área privativa, mezanino, bwc. Loja com posicionamento especial, na entrada do acesso ao prédio, com grande vitrine e amplo estacionamento. A loja possui 01 vaga de garagem privativa. Próx. Bombeiros, Colégio José Boiteux, Policlínica Beiramar Continental, DETRAN, Makro. Condomínio com 3 Elevadores de alta performance; Piso em porcelanato; Hall de entrada decorado e com moderno; Controle de acesso IP em área estratégicas do condomínio; Sala de conferências decorada, climatizada e equipada; Estacionamento rotativo;
Gerador próprio de energia para áreas comuns e elevadores;
Iluminação das áreas comuns em led com acionamento por sensor de presença; Central de interfonia IP e possibilidade de uso com aplicativo móvel; Central de telecomunicações com acesso monitorado; Todas as salas possuem cabeamento estruturado; Monitoramento estratégico de todas as áreas de acesso e circulação do condomínio com câmeras IP de alta resolução. 
Agende sua visita diretamente pelo whatsapp no telefone 48- 999338703  com Yohanna

